window.bookSummaryJSON = "<p>In the end...we all lose. </p> <p>How well do you think you know the Callahans? </p> <p>Yes, I'm asking you. Because I know you've been watching. The chaos, the violence, the love, and the madness - who could look away? Not me, for sure. </p> <p>My grandmother always told me...where you look is where you go. </p> <p>So I ask again, how well do you think you know the Callahans? Do you really think you understand Melody, Liam, or even Ethan? I have to wonder - will your mind be able to handle it? </p> <p>We haven't met yet, but ready or not, here I come. The true queen of Chicago. For now, you may call me Calliope. </p> <p>Contains mature themes.</p>"; 
